import React from 'react';
import { useLocation } from 'react-router-dom';
import Foreigner from './Foreigner';

const Home = () => {
  const location = useLocation();
  const backgroundcolor = location.state?.backgroundcolor;

  return (
    <>
      <h1>This is Sparta!!</h1>
      <h1 style={{ backgroundColor: backgroundcolor }}> {/* Apply the background color here */}
        <Foreigner name="Vinayak Santhosh" />
      </h1>
    </>
  );
};

export default Home;
